import { Grid ,Container} from '@mui/material'
import Cards from './molecules/Cards';
import BOOKS from './books';
import MyCard from './molecules/MyCard';

function CurrentBooks(){
    return (
    <Container style={{paddingLeft:"7%",paddingRight:"7%"}}>
      <Grid container rowSpacing={2} >
        {BOOKS.map(book=> (<Grid item xs={12} sm={6} md={4}>
          <MyCard progressBar='half' button='Finished' key={book.id} src={book.src} name={book.name} author={book.author} duration={book.duration}
          noOfReads={book.noOfReads}
          />
        </Grid>
        ))}        
      </Grid>
      </Container>
    );
}
export default CurrentBooks;
